import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <h2>Welcome to the Job Search Platform</h2>
      <Link to="/jobs">View Jobs</Link>
      <br />
      <Link to="/profile">View Profile</Link>
    </div>
  );
};

export default Home;
